    @staticmethod
    def _interpret_date(date):
        """
            None if date(UTC + 1) < current_date(UTC) - 7 days or invalid
            False if past date
            True if present/future date
        """
        try:
            date_to_test = datetime.strptime(date.strip(), '%d-%m-%Y %H:%M') - timedelta(hours=1)
        except ValueError:
            return None
        if date_to_test >= datetime.utcnow():
            return True
        elif date_to_test >= datetime.utcnow() - timedelta(days=7):
            return False
        else:
            return None

    @staticmethod
    def _parse_details_port_calls(item, cells):
        item['port_name'] = Sagunto_spider.port_name
        item['vessel'] = VesselIdentification()
        item['vessel']['name'] = cells[0]
        item['shipping_agent'] = cells[2]
        item['vessel']['type'] = cells[3]
        if item['vessel']['type'] == 'GAS LICUADO':
            item['cargo'] = Cargo()
            item['cargo']['commodity'] = 'lng'
        return item

    @staticmethod
    def _parse_port_call_date(days, hours):
        try:
            return (datetime.strptime(days.strip(), '%d-%m-%Y %H:%M')).strftime('%d-%m-%Y %H:%M')
        except ValueError:
            pass
        try:
            return (datetime.strptime(' '.join([days, hours]).strip(), '%d-%m-%Y %H.%M')).strftime(
                '%d-%m-%Y %H:%M'
            )
        except ValueError:
            return ''

    def parse_port_calls(self, response):
        sel = Selector(response)
        rows = sel.xpath('//table[@id="consultas"]/tbody/tr')
        self.logger.debug("Found {} rows on the page".format(len(rows)))
        for row in rows:
            cells = extract_row(row)
            arrival_date = self._parse_port_call_date(cells[5], cells[6])
            departure_date = self._parse_port_call_date(cells[7], cells[8])
            date_interpretation = self._interpret_date(arrival_date)
            if date_interpretation is True:
                item = EtaEvent()
                item['eta'] = arrival_date
                item['url'] = response.url
                yield self._parse_details_port_calls(item, cells)
            elif date_interpretation is False:
                item = ArrivedEvent()
                item['arrival'] = arrival_date
                item['url'] = response.url
                yield self._parse_details_port_calls(item, cells)
            date_interpretation = self._interpret_date(departure_date)
            if date_interpretation is True:
                item = EtdEvent()
                item['etd'] = departure_date
                item['url'] = response.url
                yield self._parse_details_port_calls(item, cells)
            elif date_interpretation is False:
                item = DepartedEvent()
                item['departure'] = departure_date
                item['url'] = response.url
                yield self._parse_details_port_calls(item, cells)

    @staticmethod
    def _apply_AM_PM(date):
        if len(date) < 3:
            return date
        elif date[-2:] == 'AM':
            return date[:-2].strip()
        elif date[-2:] == 'PM':
            try:
                return (
                    datetime.strptime(date[:-2].strip(), '%m/%d/%Y %H:%M') + timedelta(hours=12)
                ).strftime('%d-%m-%Y %H:%M')
            except ValueError:
                return date
        else:
            return date

    @staticmethod
    def _parse_details_vessel_operations(item, cells):
        """
            @param item must be Etdevent here
        """
        item['vessel'] = VesselIdentification()
        item['vessel']['name'] = cells[0]
        item['vessel']['type'] = cells[1]
        item['shipping_agent'] = cells[3]
        item['berth'] = cells[2]
        item['etd'] = Sagunto_spider._apply_AM_PM(cells[5])
        item['cargo'] = Cargo()
        item['cargo']['operator'] = cells[3]
        return item

    def parse_vessel_operations(self, response):
        sel = Selector(response)
        rows = sel.xpath('//table[@id="buques_operando"]/tbody/tr')
        self.logger.debug("Found {} rows on the page".format(len(rows)))
        for row in rows:
            item = EtdEvent()  # Etd only ?
            item['url'] = response.url
            yield self._parse_details_vessel_operations(item, extract_row(row))
